def getit(self):
    try:
        return self._assumptions[fact]
    except KeyError:
        if self._assumptions is self.default_assumptions:
            self._assumptions = self.default_assumptions.copy()
        return _ask(fact, self)

sympy.sympy.core.cache.wrapper:
@wraps(func)
def wrapper(*args, **kwargs):
    try:
        retval = cfunc(*args, **kwargs)
    except TypeError as e:
        if not e.args or not e.args[0].startswith('unhashable type:'):
            raise
        retval = func(*args, **kwargs)
    return retval

sympy.sympy.core.decorators._func:
@wraps(func)
def _func(self, other):
    # XXX: The check for _op_priority here should be removed. It is
    # needed to stop mutable matrices from being sympified to
    # immutable matrices which breaks things in quantum...
    if not hasattr(other, '_op_priority'):
        try:
            other = sympify(other, strict=True)
        except SympifyError:
            return retval
    if not isinstance(other, expectedcls):
        return retval
    return func(self, other)

sympy.sympy.core.decorators.__sympifyit_:
@wraps(func)
def __sympifyit_wrapper(a, b):
    try:
        # If an external class has _op_priority, it knows how to deal
        # with SymPy objects. Otherwise, it must be converted.
        if not hasattr(b, '_op_priority'):
            b = sympify(b, strict=True)
        return func(a, b)
    except SympifyError:
        return retval

sympy.sympy.core.expr.__pow__:
def __pow__(self, other, mod=None) -> Expr:
    power = self._pow(other)
    if mod is None:
        return power
    else:
        try:
            return power % mod
        except TypeError:
            return NotImplemented

sympy.sympy.core.mul.as_real_imag:
def as_real_imag(self, deep=True, **hints):
    from sympy.functions.elementary.complexes import Abs, im, re
    other = []
    coeffr = []
    coeffi = []
    addterms = S.One
    for a in self.args:
        r, i = a.as_real_imag()
        if i.is_zero:
            coeffr.append(r)
        elif r.is_zero:
            coeffi.append(i*S.ImaginaryUnit)
        elif a.is_commutative:
            aconj = a.conjugate() if other else None
            # search for complex conjugate pairs:
            for i, x in enumerate(other):
                if x == aconj:
                    coeffr.append(Abs(x)**2)
                    del other[i]
                    break
            else:
                if a.is_Add:
                    addterms *= a
                else:
                    other.append(a)
        else:
            other.append(a)
    m = self.func(*other)
    if hints.get('ignore') == m:
        return
    if len(coeffi) % 2:
        imco = im(coeffi.pop(0))
        # all other pairs make a real factor; they will be
        # put into reco below
    else:
        imco = S.Zero
    reco = self.func(*(coeffr + coeffi))
    r, i = (reco*re(m), reco*im(m))
    if addterms == 1:
        if m == 1:
            if imco.is_zero:
                return (reco, S.Zero)
            else:
                return (S.Zero, reco*imco)
        if imco is S.Zero:
            return (r, i)
        return (-imco*i, imco*r)
    from .function import expand_mul
    addre, addim = expand_mul(addterms, deep=False).as_real_imag()
    if imco is S.Zero:
        return (r*addre - i*addim, i*addre + r*addim)
    else:
        r, i = -imco*i, imco*r
        return (r*addre - i*addim, r*addim + i*addre)

sympy.sympy.core.numbers.__mul__:
def __mul__(self, other):
    if global_parameters.evaluate:
        if isinstance(other, int):
            return Integer(self.p*other)
        elif isinstance(other, Integer):
            return Integer(self.p*other.p)
        elif isinstance(other, Rational):
            return Rational._new(self.p*other.p, other.q, igcd(self.p, other.q))
        return Rational.__mul__(self, other)
    return Rational.__mul__(self, other)

sympy.sympy.core.numbers.__pow__:
def __pow__(self, other, mod=None):
    if mod is not None:
        try:
            other_int = as_int(other)
            mod_int = as_int(mod)
        except ValueError:
            pass
        else:
            return Integer(pow(self.p, other_int, mod_int))

    return super().__pow__(other, mod)

sympy.sympy.core.operations._from_args:
@classmethod
def _from_args(cls, args, is_commutative=None):
    """Create new instance with already-processed args.
    If the args are not in canonical order, then a non-canonical
    result will be returned, so use with caution. The order of
    args may change if the sign of the args is changed."""
    if len(args) == 0:
        return cls.identity
    elif len(args) == 1:
        return args[0]

    obj = super().__new__(cls, *args)
    if is_commutative is None:
        is_commutative = fuzzy_and(a.is_commutative for a in args)
    obj.is_commutative = is_commutative
    return obj

sympy.sympy.core.power._eval_expand_powe:
def _eval_expand_power_base(self, **hints):
    """(a*b)**n -> a**n * b**n"""
    force = hints.get('force', False)

    b = self.base
    e = self.exp
    if not b.is_Mul:
        return self

    cargs, nc = b.args_cnc(split_1=False)

    # expand each term - this is top-level-only
    # expansion but we have to watch out for things
    # that don't have an _eval_expand method
    if nc:
        nc = [i._eval_expand_power_base(**hints)
            if hasattr(i, '_eval_expand_power_base') else i
            for i in nc]

        if e.is_Integer:
            if e.is_positive:
                rv = Mul(*nc*e)
            else:
                rv = Mul(*[i**-1 for i in nc[::-1]]*-e)
            if cargs:
                rv *= Mul(*cargs)**e
            return rv

        if not cargs:
            return self.func(Mul(*nc), e, evaluate=False)

        nc = [Mul(*nc)]

    # sift the commutative bases
    other, maybe_real = sift(cargs, lambda x: x.is_extended_real is False,
        binary=True)
    def pred(x):
        if x is S.ImaginaryUnit:
            return S.ImaginaryUnit
        polar = x.is_polar
        if polar:
            return True
        if polar is None:
            return fuzzy_bool(x.is_extended_nonnegative)
    sifted = sift(maybe_real, pred)
    nonneg = sifted[True]
    other += sifted[None]
    neg = sifted[False]
    imag = sifted[S.ImaginaryUnit]
    if imag:
        I = S.ImaginaryUnit
        i = len(imag) % 4
        if i == 0:
            pass
        elif i == 1:
            other.append(I)
        elif i == 2:
            if neg:
                nonn = -neg.pop()
                if nonn is not S.One:
                    nonneg.append(nonn)
            else:
                neg.append(S.NegativeOne)
        else:
            if neg:
                nonn = -neg.pop()
                if nonn is not S.One:
                    nonneg.append(nonn)
            else:
                neg.append(S.NegativeOne)
            other.append(I)
        del imag

    # bring out the bases that can be separated from the base

    if force or e.is_integer:
        # treat all commutatives the same and put nc in other
        cargs = nonneg + neg + other
        other = nc
    else:
        # this is just like what is happening automatically, except
        # that now we are doing it for an arbitrary exponent for which
        # no automatic expansion is done

        assert not e.is_Integer

        # handle negatives by making them all positive and putting
        # the residual -1 in other
        if len(neg) > 1:
            o = S.One
            if not other and neg[0].is_Number:
                o *= neg.pop(0)
            if len(neg) % 2:
                o = -o
            for n in neg:
                nonneg.append(-n)
            if o is not S.One:
                other.append(o)
        elif neg and other:
            if neg[0].is_Number and neg[0] is not S.NegativeOne:
                other.append(S.NegativeOne)
                nonneg.append(-neg[0])
            else:
                other.extend(neg)
        else:
            other.extend(neg)
        del neg

        cargs = nonneg
        other += nc

    rv = S.One
    if cargs:
        if e.is_Rational:
            npow, cargs = sift(cargs, lambda x: x.is_Pow and
                x.exp.is_Rational and x.base.is_number,
                binary=True)
            rv = Mul(*[self.func(b.func(*b.args), e) for b in npow])
        rv *= Mul(*[self.func(b, e, evaluate=False) for b in cargs])
    if other:
        rv *= self.func(Mul(*other), e, evaluate=False)
    return rv
